import Vue from 'vue'
import Router from 'vue-router'
import Exam from './components/Exam.vue'
import ExamMessageBox from './components/ExamMessageBox.vue'
import ExamField from './components/Field.vue'
import Login from "./components/Login.vue";
import MyField_taobao from "./components/MyField_taobao_05.vue"
import ExamForm from "./components/ExamForm06.vue"
import ExamContainer from "./components/ExamContainer.vue"
import ExamNavbar from "./components/ExamNavbar.vue"
import Fe from './components/F.vue'
import xzhome from "./components/xz/Home.vue"
// import product from "./components/xz/product.vue"
import home from "./components/weixin/Home.vue"
import xzlogin from "./components/xz/login"
// import messagelist from "./components/weixin/common/MessageList"


Vue.use(Router)

export default new Router({
  routes: [
    {path:"/Exam01",component:Exam},
    {path:"/ExamMessageBox",component:ExamMessageBox},
    {path:"/ExamField",component:ExamField},
    {path:"/Login",component:Login},
    {path:"/MyField_taobao",component:MyField_taobao},
    {path:"/ExamForm",component:ExamForm},
    {path:"/Container",component:ExamContainer},
    {path:"/navbar",component:ExamNavbar},
    {path:"/fff",component:Fe},
    {path:"/home",component:home},
    {path:"/xzlogin",component:xzlogin},
    // {path:"/product",component:product},
    {path:"/xzhome",component:xzhome},
    {path:'/',redirect:"/xzhome"} 
    // {path:"/messagelist",component:messagelist}
    // ,{path:"/cart",component:cart}
  ]
})
